export default class Header extends Component {
	render() {
		return (
			<div className='container'>
				<div className="row">
					<div className="col-md-3">Logo</div>
					<div className="col-md-auto">Search</div>
					<div className="col-md-4 .row">
						Sign-In!
					</div>
				</div>
			</div>
		)
	}
}
